import React, { Fragment, Component } from 'react';
import './App.css';

class App extends Component {

  render() {

    const name = "Victória Vilas Boas";
    return (
      <Fragment>
        <h1>Hello {name}</h1>
      </Fragment>
    );
  }

}

export default App;
